function create_download(url) {
  var urlargs = url.split("/");  
  dlposition = $.inArray('downloads', urlargs); //this is because the links are coded in different ways, so there's no guarantee that it's really going to be the same everywehre.
  if (urlargs[dlposition + 1] == "divx") {
    post_download = Drupal.settings.lang_prefix + '/software/download/start/';
    if(typeof(urlargs[dlposition + 2]) != 'undefined' && urlargs[dlposition + 2] == "mac") {  
      post_download = Drupal.settings.lang_prefix + '/software/download/start/mac';
    }
  }
  else {
    post_download = Drupal.settings.lang_prefix + '/software/download/start/' + urlargs[dlposition+ 1];
  }
    //ihackthereforeiam
  if($.inArray('cnet', urlargs) ){
    post_download = Drupal.settings.lang_prefix + '/software/download/start/';
  }
 window.location.replace(post_download);
 window.open(url);
}
